import Header from '../../components/layouts/Header';

import Footer from '../../components/layouts/Footer';
import About from '../../components/bout/About';


const ContactPage = () => {
  return (
    <>
      <Header />
      
       <About />
      <Footer />
    </>
  );
};

export default ContactPage;
